(10890,	'рассказывая истории',	'Отказываемся от позы\r\nИз-за травмы запястья не могу опираться на ладонь, получается опираться только на кулаки. Пришлось отказаться от позы мужчина сзади, потому что чувствую себя не игривой кошечкой, а самкой гориллы.\r\n',	1,	0,	'#EFCFFF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'50',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
