(10892,	'рассказывая истории',	'Три танкиста\r\nВ детстве благодаря старшему брату я выучила песню \"Три танкиста\" с незначительной модификацией. \"В эту ночь решили самураи, Перейти границу, мудаки...\"\r\nА петь мелкой я любила. Имела большой успех на демонстрациях, когда мне не успевали рот зажать... ',	1,	0,	'#C7E6FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	13,	'ru',	1,	'',	'',	'',	0,	'',	3,	0,	0,	'488',	'',	0,	'',	'4',	'',	'1',	'1',	'0',	'',	''),
(10893,	'рассказывая истории',	'Три танкиста\r\nВ детстве благодаря старшему брату я выучила песню \"Три танкиста\" с незначительной модификацией. \"В эту ночь решили самураи, Перейти границу, мудаки...\"\r\nА петь мелкой я любила. Имела большой успех на демонстрациях, когда мне не успевали рот зажать...',	1,	1,	'#BAE5FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	13,	'ru',	0,	'',	'',	'',	0,	'',	3,	0,	0,	'694',	'',	0,	'',	'4',	'',	'1',	'1',	'0',	'',	''),
(10894,	'рассказывая истории',	'Диалоги на собеседовании\r\nПозвонили мне сегодня и пригласили на собеседование в одну контору, там состоялся очень занимательный диалог с тетечкой из отдела кадров:\r\n- Вы оптимист?\r\n- Почему вы спрашиваете?\r\n- Ну как вы справляетесь с жизненными трудностями?\r\n- То есть, вы хотите сказать - зарплату у вас задерживают?\r\n- Да...',	1,	1,	'#7AFFE7',	'',	'',	'',	'',	0,	'',	'',	49,	7,	0,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'936',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
