(10896,	'рассказывая истории',	'Правильно заправляем одеяло в пододеяльник.\r\nС мужем мы уже третий год. И сегодня он впервые увидел как я заправляю одеяло в пододеяльник. И эта бездушная скотина выложил это на ютуб! Не понимаю, что может быть смешного, если я залажу вместе с одеялом и быстрым движением звезды расправляю одеяло непосредственно внутри...\r\n',	1,	1,	'#E9FFA3',	'',	'',	'',	'',	0,	'',	'',	49,	0,	9,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'46',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10897,	'рассказывая истории',	'Правильно заправляем одеяло в пододеяльник.\r\nС мужем мы уже третий год. И сегодня он впервые увидел как я заправляю одеяло в пододеяльник. И эта бездушная скотина выложил это на ютуб! Не понимаю, что может быть смешного, если я залажу вместе с одеялом и быстрым движением звезды расправляю одеяло непосредственно внутри...\r\n ',	1,	0,	'#E9FFA3',	'',	'',	'',	'',	0,	'',	'',	49,	0,	9,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'46',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10898,	'рассказывая истории',	'И так бывает\r\nЕхали к другу, хотели взять с собой выпивки, нас на остановке загребли. Утром выпустили, по дороге упал. Поехали в травмпункт, наложили гипс на ногу. Друг пошел за костылями - упал, вернулся к вечеру, гипс на руке. Костыли принес. Решили никуда не ходить, позвали друга к себе, попросили взять пива. Его на остановке забрали. Молимся о его здравии.\r\n',	1,	1,	'#87BEFF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	13,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'630',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
