(10906,	'рассказывая истории',	'Волшебный психолог\r\nСвою старенькую русскую маму Лена вывезла, наконец, из родной, но такой невыносимо чужой узбекской деревни. Деньги от продажи дома не покрыли даже сам переезд. Но это ерунда, главное, что в Подмосковье старушку ждал ее новый дом – маленькая «однушка» в страшноватенькой пятиэтажке. На что уж денег хватило. ',	1,	1,	'#FFF48A',	'',	'',	'',	'',	0,	'',	'',	49,	34,	13,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'473',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
