(10943,	'рассказывая истории',	'Доисторический мультфильм\r\nДоговорились с детьми, что вечером посмотрим СОВЕТСКИЙ мультфильм про Маугли.Ближе к вечеру дочь напоминает:\r\n- Мама, мы собирались смотреть ДОИСТОРИЧЕСКИЙ мультик!\r\n',	2,	0,	'#FF77FE',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1458',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10944,	'рассказывая истории',	'Сына выдал\r\nИдём с сыном (5 лет) по улице, беседуем о том, о сем. Спокойненько так идём. И вдруг так он выдаёт: \"Хорошая ты всё-таки баба, когда не орёшь\"\r\n',	1,	1,	'#F9FFC9',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'649',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10945,	'рассказывая истории',	'Сына выдал\r\nИдём с сыном (5 лет) по улице, беседуем о том, о сем. Спокойненько так идём. И вдруг так он выдаёт: \"Хорошая ты всё-таки баба, когда не орёшь\"\r\n',	1,	0,	'#AFE0CA',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'622',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10946,	'рассказывая истории',	'Дошутились\r\nЛучшая первоапрельская шутка, за которую люди поплатились работой. Где-то в отдалённом регионе 1 апреля на канале местного телевидения с утра начали крутить \"Лебединое озеро\". Периодически трансляция балета прерывалась появлением диктора в строгом чёрном костюме с объявлением: \"Граждане, сохраняйте спокойствие. Правительство держит ситуацию под контролем\".\r\n',	1,	1,	'#DCFF57',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'385',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10947,	'рассказывая истории',	'Дошутились\r\nЛучшая первоапрельская шутка, за которую люди поплатились работой. Где-то в отдалённом регионе 1 апреля на канале местного телевидения с утра начали крутить \"Лебединое озеро\". Периодически трансляция балета прерывалась появлением диктора в строгом чёрном костюме с объявлением: \"Граждане, сохраняйте спокойствие. Правительство держит ситуацию под контролем\".\r\n',	1,	0,	'#BFFFFB',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'506',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10948,	'рассказывая истории',	'Срыв совещания\r\nРаботаю в крупной организации в группе работы с потребителями.\r\nВчера приходил представитель управляющей компании (девушка) и надолго сорвал рабочий процесс. Ей достаточно было с порога сказать: - Я с УКа \"Барс\". Отдайте мне документы...\r\n',	1,	1,	'#ECFF4E',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'753',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10949,	'рассказывая истории',	'Срыв совещания\r\nРаботаю в крупной организации в группе работы с потребителями.\r\nВчера приходил представитель управляющей компании (девушка) и надолго сорвал рабочий процесс. Ей достаточно было с порога сказать: - Я с УКа \"Барс\". Отдайте мне документы...',	1,	0,	'#DAFFAD',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1059',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10950,	'рассказывая истории',	'ПОНЕДЕЛЬНИК\r\nПоехал в Аять. Федорыч говорит надо туда телек срочно во второй дом привезти. Ящик старый, тот еще который с огромной жопой, и тяжелый настолько, что в одного не приподнять. А все ведь знают, что перед тем как выбросить вещь, надо чтобы она на даче помучилась. ',	1,	1,	'#FFE163',	'',	'',	'',	'',	0,	'',	'',	49,	40,	16,	'ru',	0,	'',	'',	'',	0,	'',	3,	0,	0,	'631',	'',	0,	'',	'4',	'',	'1',	'1',	'0',	'',	''),
(10951,	'рассказывая истории',	'ПОНЕДЕЛЬНИК\r\nПоехал в Аять. Федорыч говорит надо туда телек срочно во второй дом привезти. Ящик старый, тот еще который с огромной жопой, и тяжелый настолько, что в одного не приподнять. А все ведь знают, что перед тем как выбросить вещь, надо чтобы она на даче помучилась.',	1,	0,	'#FFE163',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'631',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10952,	'рассказывая истории',	'Наша демократия\r\nКупила зубные щётки (в наборе 2 шт., синяя и зелёная). Спрашиваю у мужа, какую он хочет щётку, и тут же, не дожидаясь его ответа, говорю:\r\n- Я выбираю зелёную.\r\nМуж:\r\n- Сейчас ты наглядно продемонстрировала, как действует демократия в нашей стране.',	2,	1,	'#FFB3D7',	'',	'',	'',	'',	0,	'',	'',	49,	0,	5,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1028',	'',	0,	'',	'4',	'4',	'0',	'0',	'0',	'',	''),
(10953,	'рассказывая истории',	'Памела Андерсон\r\nПамела Андерсон рассказала в какой-то программе:\r\n- Дома я выгляжу, как обычный человек, и сыновья всегда меня видели обычной, без причёски и макияжа. И как-то собралась куда-то, накрасилась... и выхожу к детям. Младший посмотрел на меня пристально и с ужасом: \"Подожди секунду, ты что - Памела Андерсон???\" \r\n',	1,	0,	'#0FE5FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	16,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'410',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10954,	'рассказывая истории',	'Обман зрения\r\nИстория произошла в начале 80-х прошлого века в Киеве.В одном из подразделений ВДВ служил молодой человек. И не просто служил, а был уже в чине подполковника. И не просто подполковника, а занимал в соответствии с этим званием должность.И вот захотелось ему летом прогуляться по Киеву одному. Семейная жизнь \r\n',	1,	0,	'#FF9633',	'',	'',	'',	'',	0,	'',	'',	49,	7,	5,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1454',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10955,	'рассказывая истории',	'Любофь она разная бывает\r\nПредисловие: молодой мой муж устроился на стройку сварщиком дабы молодой семье заработать квартиру. Жду его домой вечером с работы и почему то его долго нет. Ну думаю оставили на вторую смену (часто так делали рабочих рук не хватало). А ему напарника дали и наставника одновременно пожилого мужчину тоже сварщика.',	1,	0,	'#9CEDFF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1223',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10956,	'рассказывая истории',	'Буква \"С\"\r\nВ последнее время отмечаю в календаре наши с мужем ссоры. Случайно календарик попался на глаза моей подруге. Задумчиво повертев его в руках, она произнесла: \"Даа... повезло тебе всё-таки с мужем. Уже пять лет вместе, а секс до сих пор почти каждый день\". Еще завистливо вздохнула при этом.\r\nНу я и не стала ее разубеждать, что буква \"С\" в календаре это не \"Секс\", а \"Ссора\". \r\n',	1,	0,	'#DCFF57',	'',	'',	'',	'',	0,	'',	'',	49,	0,	16,	'ru',	1,	'',	'',	'',	0,	'',	3,	0,	0,	'385',	'',	0,	'',	'4',	'',	'1',	'1',	'0',	'',	''),
(10957,	'рассказывая истории',	'Студенты\r\nТронусь я когда нибудь со студентов. Сегодня на приеме барышня с сотрясением, сломанным носом и синяком на поллица. Они катались в тазике по лестнице в общаге... \r\n',	1,	0,	'#63FFC9',	'',	'',	'',	'',	0,	'',	'',	49,	0,	16,	'ru',	1,	'',	'',	'',	0,	'',	3,	0,	0,	'1067',	'',	0,	'',	'4',	'',	'1',	'1',	'0',	'',	''),
(10958,	'рассказывая истории',	'О стереотипах\r\nЯ живу в столице \"Золотого кольца России\". Подруга работает на рецепшене в отеле. Однажды к ней подходят французы, пожилая пара, и спрашивают, можно ли пойти погулять в город ( отель почти в центре). Она говорит:\"Конечно, можно\"\r\n- А до скольки можно гулять?\r\n- Да хоть до утра, пока не устанете.\r\n- А медведей когда выпускают на улицу?',	1,	0,	'#FFE163',	'',	'',	'',	'',	0,	'',	'',	49,	0,	13,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'631',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10959,	'рассказывая истории',	'Аня на зарядке\r\nВ детской комнате жена кормит дочку грудью. Муж с тестем и племянником сидят на кухне. Муж заглядывает в детскую и спрашивает:\r\n– Что там Аня делает?\r\nПлемянник отвечает:\r\n– Поставила малую на зарядку.',	1,	0,	'#FF94B9',	'',	'',	'',	'',	0,	'',	'',	49,	0,	13,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1071',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10960,	'рассказывая истории',	'Никита Богословский\r\nКомпозитор Никита Богословский в 15 лет написал оперетту «Ночь перед Рождеством». Премьера состоялась в Ленинградском театре музыкальной комедии. Самого Богословского на премьеру не пустили, билетерша заявила: «Мальчик, тебе нельзя, придешь с мамой в воскресенье на утренник».',	1,	0,	'#C9DEFF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1511',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10961,	'рассказывая истории',	'Заманчивое предложение\r\nНесколько лет назад ехала на электричке и на станции, которую проезжала, заметила массовую драку. Естественно, позвонила в полицию, назвалась, сообщила о драке и обалдела, услышав предложение дежурной \"Девушка, а вы бы не могли там выйти и подождать наряд?\". \r\n',	1,	0,	'#EAFFAB',	'',	'',	'',	'',	0,	'',	'',	49,	0,	12,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1614',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10962,	'рассказывая истории',	'Вот как подарки делать то ?!\r\nВчера купил жене дорогущее кольцо. Просто так, от избытка чувств.\r\nПервое, что она спросила: “Что случилось? Скажи мне правду, даже самую страшную! Украл что-то? Изменил мне?”Сейчас сидит в углу, дуется, думает, я что-то скрываю. Лучше бы я ей сковородку какую-нибудь купил! \r\n',	0,	0,	'#F7FF3B',	'',	'',	'',	'',	0,	'',	'',	49,	21,	9,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'619',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10963,	'рассказывая истории',	'Детские рисунки\r\nПару недель назад к нам домой пришёл психиатр с детского сада. Он показал результаты психологического теста моего младшего брата. Как оказалось, на одном из его рисунков была изображена наша семья: мама, папа, я, младший брат и пи$дакрыл. Как я узнал о пи$дакрыле? Он был подписан.',	1,	0,	'#FDFF5A',	'',	'',	'',	'',	0,	'',	'',	49,	0,	13,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'692',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10964,	'Раздевайся!',	'Да, хозяин.',	1,	0,	'#FFBDED',	'',	'',	'',	'',	0,	'',	'',	21,	36,	5,	'ru',	1,	'',	'26',	'msg',	0,	'',	1,	0,	0,	'458',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
