(10975,	'рассказывая истории',	'Наша демократия\r\nКупила зубные щётки (в наборе 2 шт., синяя и зелёная). Спрашиваю у мужа, какую он хочет щётку, и тут же, не дожидаясь его ответа, говорю:\r\n- Я выбираю зелёную.\r\nМуж:\r\n- Сейчас ты наглядно продемонстрировала, как действует демократия в нашей стране.',	2,	0,	'#FF9487',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'916',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10976,	'рассказывая истории',	'Памела Андерсон\r\nПамела Андерсон рассказала в какой-то программе:\r\n- Дома я выгляжу, как обычный человек, и сыновья всегда меня видели обычной, без причёски и макияжа. И как-то собралась куда-то, накрасилась... и выхожу к детям. Младший посмотрел на меня пристально и с ужасом: \"Подожди секунду, ты что - Памела Андерсон???\" \r\n',	1,	1,	'#E9FFA3',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'46',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10977,	'рассказывая истории',	'Обман зрения\r\nИстория произошла в начале 80-х прошлого века в Киеве.В одном из подразделений ВДВ служил молодой человек. И не просто служил, а был уже в чине подполковника. И не просто подполковника, а занимал в соответствии с этим званием должность.И вот захотелось ему летом прогуляться по Киеву одному. Семейная жизнь ',	1,	1,	'#FDFF12',	'',	'',	'',	'',	0,	'',	'',	49,	7,	5,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'621',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10978,	'рассказывая истории',	'Любофь она разная бывает\r\nПредисловие: молодой мой муж устроился на стройку сварщиком дабы молодой семье заработать квартиру. Жду его домой вечером с работы и почему то его долго нет. Ну думаю оставили на вторую смену (часто так делали рабочих рук не хватало). А ему напарника дали и наставника одновременно пожилого мужчину тоже сварщика.',	1,	1,	'#FFB3D7',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1028',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10979,	'рассказывая истории',	'Буква \"С\"\r\nВ последнее время отмечаю в календаре наши с мужем ссоры. Случайно календарик попался на глаза моей подруге. Задумчиво повертев его в руках, она произнесла: \"Даа... повезло тебе всё-таки с мужем. Уже пять лет вместе, а секс до сих пор почти каждый день\". Еще завистливо вздохнула при этом.\r\nНу я и не стала ее разубеждать, что буква \"С\" в календаре это не \"Секс\", а \"Ссора\". \r\n',	1,	1,	'#F1C7FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	16,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1157',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10980,	'рассказывая истории',	'Студенты\r\nТронусь я когда нибудь со студентов. Сегодня на приеме барышня с сотрясением, сломанным носом и синяком на поллица. Они катались в тазике по лестнице в общаге... \r\n',	1,	1,	'#FFE0F3',	'',	'',	'',	'',	0,	'',	'',	49,	7,	16,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'45',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10981,	'рассказывая истории',	'О стереотипах\r\nЯ живу в столице \"Золотого кольца России\". Подруга работает на рецепшене в отеле. Однажды к ней подходят французы, пожилая пара, и спрашивают, можно ли пойти погулять в город ( отель почти в центре). Она говорит:\"Конечно, можно\"\r\n- А до скольки можно гулять?\r\n- Да хоть до утра, пока не устанете.\r\n- А медведей когда выпускают на улицу?',	1,	1,	'#FFF059',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'629',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10982,	'рассказывая истории',	'Аня на зарядке\r\nВ детской комнате жена кормит дочку грудью. Муж с тестем и племянником сидят на кухне. Муж заглядывает в детскую и спрашивает:\r\n– Что там Аня делает?\r\nПлемянник отвечает:\r\n– Поставила малую на зарядку.',	1,	1,	'#D2FFA3',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1276',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10983,	'рассказывая истории',	'Никита Богословский\r\nКомпозитор Никита Богословский в 15 лет написал оперетту «Ночь перед Рождеством». Премьера состоялась в Ленинградском театре музыкальной комедии. Самого Богословского на премьеру не пустили, билетерша заявила: «Мальчик, тебе нельзя, придешь с мамой в воскресенье на утренник».',	1,	1,	'#FFA6D8',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'475',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
