(10994,	'рассказывая истории',	'Заманчивое предложение\r\nНесколько лет назад ехала на электричке и на станции, которую проезжала, заметила массовую драку. Естественно, позвонила в полицию, назвалась, сообщила о драке и обалдела, услышав предложение дежурной \"Девушка, а вы бы не могли там выйти и подождать наряд?\". ',	1,	1,	'#FFD33D',	'',	'',	'',	'',	0,	'',	'',	49,	0,	12,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'611',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10995,	'рассказывая истории',	'Вот как подарки делать то ?!\r\nВчера купил жене дорогущее кольцо. Просто так, от избытка чувств.\r\nПервое, что она спросила: “Что случилось? Скажи мне правду, даже самую страшную! Украл что-то? Изменил мне?”Сейчас сидит в углу, дуется, думает, я что-то скрываю. Лучше бы я ей сковородку какую-нибудь купил! \r\n',	0,	1,	'#FFC740',	'',	'',	'',	'',	0,	'',	'',	49,	21,	9,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'469',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(10996,	'рассказывая истории',	'Детские рисунки\r\nПару недель назад к нам домой пришёл психиатр с детского сада. Он показал результаты психологического теста моего младшего брата. Как оказалось, на одном из его рисунков была изображена наша семья: мама, папа, я, младший брат и пи$дакрыл. Как я узнал о пи$дакрыле? Он был подписан.',	1,	1,	'#FFC474',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'921',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
