(11001,	'рассказывая истории',	'А что, так можно было?!\r\nОднажды один американец по имени Ларри Рутман кинул бумеранг, который вернулся и ударил его по голове. Ларри подал сам на себя иск о возмещении ущерба на сумму 300.000 долларов и выиграл дело. Деньги за нанесение побоев самому себе ему выплатила страховая компания, в которой Ларри застраховался от подобных исков.\r\n',	1,	1,	'#D2FFA3',	'',	'',	'',	'',	0,	'',	'',	49,	0,	12,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1276',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11002,	'рассказывая истории',	'А что, так можно было?!\r\nОднажды один американец по имени Ларри Рутман кинул бумеранг, который вернулся и ударил его по голове. Ларри подал сам на себя иск о возмещении ущерба на сумму 300.000 долларов и выиграл дело. Деньги за нанесение побоев самому себе ему выплатила страховая компания, в которой Ларри застраховался от подобных исков.',	1,	0,	'#DDA8FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	12,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'559',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11003,	'рассказывая истории',	'Почему ты так решил?\r\nБыли у психолога на приеме по поводу заикания со средним. Его спрашивает психолог, кто главный в семье. Ребенок быстро отвечает: \"Папа.\" Следующий вопрос: \"Почему ты так решил?\". \"Мама сказала\" - ответил сына. Психолог втихаря все пыталась выспросить у меня кто все же главный, а папа долго смеялся.\r\n',	1,	1,	'#FFE587',	'',	'',	'',	'',	0,	'',	'',	49,	0,	5,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1146',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11004,	'рассказывая истории',	'Почему ты так решил?\r\nБыли у психолога на приеме по поводу заикания со средним. Его спрашивает психолог, кто главный в семье. Ребенок быстро отвечает: \"Папа.\" Следующий вопрос: \"Почему ты так решил?\". \"Мама сказала\" - ответил сына. Психолог втихаря все пыталась выспросить у меня кто все же главный, а папа долго смеялся. \r\n',	1,	0,	'#D6FFFE',	'',	'',	'',	'',	0,	'',	'',	49,	0,	5,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'507',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11005,	'рассказывая истории',	'Еда из супермаркета\r\nЛежу с дитем в инфекции. Муж готовить не умеет и приносит мне готовую еду из супермаркета.Как оказалось - есть салатики из маркета прям в инфекционке это ооочень продуманно!\r\n',	1,	1,	'#C2FF82',	'',	'',	'',	'',	0,	'',	'',	49,	0,	7,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1203',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11006,	'рассказывая истории',	'Еда из супермаркета\r\nЛежу с дитем в инфекции. Муж готовить не умеет и приносит мне готовую еду из супермаркета.Как оказалось - есть салатики из маркета прям в инфекционке это ооочень продуманно!',	1,	0,	'#FFA8F0',	'',	'',	'',	'',	0,	'',	'',	49,	0,	7,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'478',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11007,	'рассказывая истории',	'Наши стесняши\r\nНа банкете тут поспорили, на что похожи мидии по вкусу. Няша-стесняша из соседнего отдела сообщила, что на сперму. Мы только глазами хлопнули, как наш бородатый мачо-сисадмин отвечает: \"Вообще-то на сперму похожи осьминоги\".\r\nИ что мне делать? А я с ним замутить хотела...\r\n',	1,	1,	'#DC94FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	16,	'ru',	0,	'',	'',	'',	0,	'',	3,	0,	0,	'594',	'',	0,	'',	'4',	'',	'1',	'1',	'0',	'',	''),
(11008,	'рассказывая истории',	'Наши стесняши\r\nНа банкете тут поспорили, на что похожи мидии по вкусу. Няша-стесняша из соседнего отдела сообщила, что на сперму. Мы только глазами хлопнули, как наш бородатый мачо-сисадмин отвечает: \"Вообще-то на сперму похожи осьминоги\".\r\nИ что мне делать? А я с ним замутить хотела...',	1,	0,	'#DC94FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	16,	'ru',	1,	'',	'',	'',	0,	'',	3,	0,	0,	'594',	'',	0,	'',	'4',	'',	'1',	'1',	'0',	'',	''),
(11009,	'рассказывая истории',	'Обидно\r\nТолько что, пока я отходил взвешивать огурцы, у меня украли в магазине полную тележку неоплаченных продуктов, и скажу вам, что это не менее обидно, чем если бы я уже за них расплатился.\r\n',	1,	1,	'#A1F08A',	'',	'',	'',	'',	0,	'',	'',	49,	0,	1,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'159',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11010,	'рассказывая истории',	'Обидно.\r\nТолько что, пока я отходил взвешивать огурцы, у меня украли в магазине полную тележку неоплаченных продуктов, и скажу вам, что это не менее обидно, чем если бы я уже за них расплатился.',	1,	0,	'#B2FFAA',	'',	'',	'',	'',	0,	'',	'',	49,	0,	1,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'616',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11011,	'рассказывая истории',	'Разрыв шаблона\r\nВчера произошёл разрыв шаблона!!!\r\nДевушка позвала к себе для любовных утех. Я как умный Вася подготовился: купил цветов, зашёл в аптеку, надел свои лучшие трусы. Прихожу к ней, а оказывается, её родители попросили под любым предлогом заманить меня домой, чтобы я им комп починил!!!\r\n',	1,	0,	'#FFCE94',	'',	'',	'',	'',	0,	'',	'',	49,	21,	9,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1202',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11012,	'рассказывая истории',	'Хобби великих людей\r\nСыну в 7 классе задали сочинение на тему \"Хобби великих людей\". Он что-то нашёл в интернете, списал и лёг спать. В ночи я решила почитать его опус. \"А. Блок коллекционировал волосы с лобков любимых женщин..\". Ребёнок просто думал это пряди со лба. До утра переписывали про Агнию Барто',	1,	0,	'#AAFF4D',	'',	'',	'',	'',	0,	'',	'',	49,	0,	7,	'ru',	1,	'',	'',	'',	0,	'',	3,	0,	0,	'634',	'',	0,	'',	'4',	'4',	'1',	'1',	'0',	'',	''),
(11013,	'рассказывая истории',	'Отшиваем ромал правильно\r\nСтою я как-то на вокзале, встречаю поезд. Подходит цыганка с двумя детьми лет 4 - 5 и ещё одним совсем мелким на руках. Просит, как обычно, денежку в обмен на нереальную удачу и фантастическое счастье (а ты сама-то сильно счастлива?!). Нахожу и протягиваю ей... презерватив. Столько ненависти в глазах ромалэ я не видел никогда.',	1,	0,	'#FFF7AD',	'',	'',	'',	'',	0,	'',	'',	49,	10,	16,	'ru',	1,	'',	'',	'',	0,	'',	3,	0,	0,	'464',	'',	0,	'',	'4',	'',	'1',	'1',	'0',	'',	''),
(11014,	'рассказывая истории',	'Вот что делать?\r\nСидим в классе автошколы. Инструктор, показывая реверсионный светофор, задает вопрос:\r\n- Вот что делать, если вы ехали по реверсионной дороге, а светофор взял и погас?\r\nВ классе тишина, и женский голос неуверенно:\r\n- Паниковать?',	1,	0,	'#FF81B2',	'',	'',	'',	'',	0,	'',	'',	49,	0,	14,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1576',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11015,	'рассказывая истории',	'Фейл\r\nУ меня сегодня был просто идиотский фейл. Интереса ради начал разбирать отработанный пустой перцовый баллончик. Во время развальцовки верхней части рука соскочила, поцарапал палец об острые края, на которых было немного ядрёной перцовой жидкости. Рану начало дико щипать, и я засунул палец в рот... \r\n',	1,	0,	'#FFCB7A',	'',	'',	'',	'',	0,	'',	'',	49,	0,	13,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'882',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
