(11047,	'рассказывая истории',	'Хобби великих людей\r\nСыну в 7 классе задали сочинение на тему \"Хобби великих людей\". Он что-то нашёл в интернете, списал и лёг спать. В ночи я решила почитать его опус. \"А. Блок коллекционировал волосы с лобков любимых женщин..\". Ребёнок просто думал это пряди со лба. До утра переписывали про Агнию Барто',	1,	1,	'#FF755E',	'',	'',	'',	'',	0,	'',	'',	49,	0,	12,	'ru',	0,	'',	'',	'',	0,	'',	3,	0,	0,	'371',	'',	0,	'',	'4',	'4',	'1',	'1',	'0',	'',	''),
(11048,	'рассказывая истории',	'Отшиваем ромал правильно\r\nСтою я как-то на вокзале, встречаю поезд. Подходит цыганка с двумя детьми лет 4 - 5 и ещё одним совсем мелким на руках. Просит, как обычно, денежку в обмен на нереальную удачу и фантастическое счастье (а ты сама-то сильно счастлива?!). Нахожу и протягиваю ей... презерватив. Столько ненависти в глазах ромалэ я не видел никогда.',	1,	1,	'#FFF7AD',	'',	'',	'',	'',	0,	'',	'',	49,	10,	16,	'ru',	0,	'',	'',	'',	0,	'',	3,	0,	0,	'464',	'',	0,	'',	'4',	'4',	'1',	'1',	'0',	'',	''),
(11049,	'рассказывая истории',	'Вот что делать?\r\nСидим в классе автошколы. Инструктор, показывая реверсионный светофор, задает вопрос:\r\n- Вот что делать, если вы ехали по реверсионной дороге, а светофор взял и погас?\r\nВ классе тишина, и женский голос неуверенно:\r\n- Паниковать?',	1,	1,	'#93ECFF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	14,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1599',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
