(11078,	'рассказывая истории',	'Как отговорить от затеи\r\nКогда мы с сестрой были маленькие, очень сильно хотели слона. Мама сказала, что будет нам слон... Только при одном условии: он будет стоять головой в родительскую спальню, а попой, соответственно, к нам в детскую. Они с папой его будут кормить, а мы убирать. От затеи мы отказались\r\n',	1,	1,	'#FFEE6B',	'',	'',	'',	'',	0,	'',	'',	49,	0,	9,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1187',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
