(11086,	'рассказывая истории',	'Зачем?\r\nАлексей Леонов рассказывал о возвращении из космоса. Говорит:\r\n- Приземлились мы в какой-то тундре. И тут же начали прилетать самолёты, вертолёты. Скинули нам бутылку коньяка, которая разбилась, термос с чаем, тоже разбился, топор скинули. Думаю, топор-то зачем?!\r\n',	1,	1,	'#AAFF4D',	'',	'',	'',	'',	0,	'',	'',	49,	0,	16,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'634',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
