(11088,	'рассказывая истории',	'Душевные люди\r\nТаксист, выслушав моё \"я опаздываю\", посоветовал сказать начальству \"да му%ак какой-то вёз и не туда завёз, час потратил\".Отличная страна. Душевные люди. Всё нравится.\r\n',	1,	1,	'#F5BAFF',	'',	'',	'',	'',	0,	'',	'',	49,	7,	5,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1002',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
