(11090,	'рассказывая истории',	'Лайфхак\r\nНа работе постоянно смотрю в монитор, зрение садится. И так работой увлечен, что даже забываю делать перерывы для отдыха глаз. А потом я купил шиповниковый чай. Раз в час стабильно в туалет хожу, глаза хоть отдыхают.\r\n',	1,	0,	'#FFE0F3',	'',	'',	'',	'',	0,	'',	'',	49,	0,	9,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'45',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11091,	'рассказывая истории',	'Задачка\r\nВчера придумал задачку для учеников старших классов: \"Если мировые цены за \"бочку\" нефти поднимают на 5%, то наши внутренние на бензин поднимают на 3%, а если мировые цены за \"бочку\" нефти опускают на 5%, то наши внутренние на бензин поднимают на 8%. Необходимо найти формулу этой зависимости\".',	1,	0,	'#FFC740',	'',	'',	'',	'',	0,	'',	'',	49,	0,	12,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'469',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11092,	'рассказывая истории',	'Я в роуминг\r\nРаботала у нас сотрудница, любительница выпить. Как-то она не вышла на работу, ей звонит начальник: \"Ирина, ты где?\". А она еле говорит, язык заплетается: \"Я в роуминге, не звони мне\", и положила трубку. С тех пор, если кто-то собрался забухать, говорит \"Я в роуминг!\"',	2,	0,	'#EFCFFF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'50',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11093,	'рассказывая истории',	'Юмористка\r\nВчера вечером жена отложила в сторону какой-то слезливый роман и мечтательно вздохнула: «Хочу ребенка от любимого мужчины». Потом глянула на меня и добавила: «А если не найду такого, то и ты сгодишься». Чуть не убил юмористку! \r\n',	1,	0,	'#E9FFA3',	'',	'',	'',	'',	0,	'',	'',	49,	0,	6,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'46',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
