(11127,	'рассказывая истории',	'Лучше растить сына\r\nНедавно довелось случайно услышать беседу двух женщин, уже в возрасте. Говорит одна: \"Вот все-таки гораздо лучше растить сына. Живет он с тобой лет до 25-ти, ну 30-ти... потом женился, переехал...все! Дочь же - всю жизнь на чемоданах: \"мама, я ухожу..\", \" мама, я у вас поживу...\"\r\n',	1,	1,	'#75FF8D',	'',	'',	'',	'',	0,	'',	'',	49,	0,	0,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'233',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
