(11129,	'рассказывая истории',	'Учебник по партизанской войне\r\nЯ в 10 лет читала учебник по ведению партизанской войны, изданный в 1943-м. Автора не помню, мои попытки найти его в зрелом возрасте успехом не увенчались. А тогда просто взяла в сельской библиотеке... Все, что мне потом попадалось по пиару, терроризму и рекламе, основано на этом учебнике!\r\n',	1,	1,	'#EFD1FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	17,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1201',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
