(11131,	'рассказывая истории',	'Поздравления\r\nСвекровь получила поздравительную открытку с 8 Марта от бывшего ухажера. Маме мужа, на минуточку, 79 лет!\r\n- Ой, сказала она, - а я думала, что он уже умер, и не поздравила его с 23 февраля, неудобно как.\r\n',	1,	1,	'#DBFF7D',	'',	'',	'',	'',	0,	'',	'',	49,	0,	9,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'95',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
