(11133,	'рассказывая истории',	'Бонус\r\nНа 23е наши девочки подарили каждому мальчику по туалетной воде. Хорошей такой, надо сказать. А сегодня был бонус: каждому мальчику по три носка! \"Мы не считаем вас мутантами, это запаска\".\r\n',	2,	1,	'#C7E6FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'488',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
