(11162,	'рассказывая истории',	'Утренний невменоз\r\nУтром собиралась на работу в каком-то невменозе. Пришла на работу. Сходила в бухгалтерию, попила чай, дважды сходила к директору и только к обеду из брючины у меня вывалился тапок. ДОМАШНИЙ ТАПОК, КАРЛ!!! Нет, я понимаю, что можно уйти из дома с торчащими колготками, но что бы уйти с тапком...\r\n',	1,	1,	'#E9FFA3',	'',	'',	'',	'',	0,	'',	'',	49,	0,	9,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'46',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11163,	'рассказывая истории',	'Утренний невменоз\r\nУтром собиралась на работу в каком-то невменозе. Пришла на работу. Сходила в бухгалтерию, попила чай, дважды сходила к директору и только к обеду из брючины у меня вывалился тапок. ДОМАШНИЙ ТАПОК, КАРЛ!!! Нет, я понимаю, что можно уйти из дома с торчащими колготками, но что бы уйти с тапком... \r\n',	1,	0,	'#E9FFA3',	'',	'',	'',	'',	0,	'',	'',	49,	0,	9,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'46',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11164,	'рассказывая истории',	'Дворовый лайфхак\r\nВо двор приехала молодёжь, врубила музон и давай плясать. Шумят, спать не дают, 12 ночи. Народ начал вылазить из окон и орать благим матом. Выглядываю в окно, крупный мужичок молча выходит из подъезда, залезает в салон, открывает капот, вырывает аккум и так же молча с ним уходит. Занавес.\r\n',	1,	1,	'#D6FFA3',	'',	'',	'',	'',	0,	'',	'',	49,	7,	12,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1280',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11165,	'рассказывая истории',	'Дворовый лайфхак\r\nВо двор приехала молодёжь, врубила музон и давай плясать. Шумят, спать не дают, 12 ночи. Народ начал вылазить из окон и орать благим матом. Выглядываю в окно, крупный мужичок молча выходит из подъезда, залезает в салон, открывает капот, вырывает аккум и так же молча с ним уходит. Занавес.',	1,	0,	'#D6FFA3',	'',	'',	'',	'',	0,	'',	'',	49,	7,	12,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1280',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11166,	'рассказывая истории',	'Смертельный перфекционизм\r\nВо время Второй Мировой войны немецкие саперы особо охотились за английскими офицерами. Отступая, в домах они минировали криво повешенные картины. На это обращали внимание хорошо воспитанные джентльмены, которые поправляли картины, приводя в действие взрывной механизм.\r\n',	1,	1,	'#FBFF91',	'',	'',	'',	'',	0,	'',	'',	49,	0,	12,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'87',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11167,	'рассказывая истории',	'Смертельный перфекционизм\r\nВо время Второй Мировой войны немецкие саперы особо охотились за английскими офицерами. Отступая, в домах они минировали криво повешенные картины. На это обращали внимание хорошо воспитанные джентльмены, которые поправляли картины, приводя в действие взрывной механизм.\r\n',	1,	0,	'#FBFF91',	'',	'',	'',	'',	0,	'',	'',	49,	0,	12,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'87',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11168,	'рассказывая истории',	'Харизма\r\nГод назад мы кастрировали кота. Летом поехали на дачу в деревню. Кота как обычно выпустили гулять. Пропал на два дня! Потом вернулся весь грязный, в компании двух кошек. Белая и рыжая, совсем молоденькие. И вот так и жили с нами на участке пол-лета. В общем, не яйца красят мужика, а ХАРИЗМА...\r\n',	1,	1,	'#FF57C0',	'',	'',	'',	'',	0,	'',	'',	49,	34,	13,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'182',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11169,	'рассказывая истории',	'Харизма\r\nГод назад мы кастрировали кота. Летом поехали на дачу в деревню. Кота как обычно выпустили гулять. Пропал на два дня! Потом вернулся весь грязный, в компании двух кошек. Белая и рыжая, совсем молоденькие. И вот так и жили с нами на участке пол-лета. В общем, не яйца красят мужика, а ХАРИЗМА...',	1,	0,	'#FF57C0',	'',	'',	'',	'',	0,	'',	'',	49,	34,	13,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'182',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11170,	'рассказывая истории',	'Зарисовка из суши-бара\r\nРаботаю официантом в суши баре, и не все умеют кушать роллы палочками. Так вот зовет один мужчина меня к столику и говорит:\r\n- Принесите, пожалуйста, вилку, а то я уже и глаза прищурил, все равно не получается палочками кушать.\r\n',	1,	1,	'#FFA48F',	'',	'',	'',	'',	0,	'',	'',	49,	7,	5,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1300',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
