(11172,	'рассказывая истории',	'Чпоки\r\nПривезли новую плиту в пленке с пупырышками. Сижу на кухне на полу, лопаю пупырышки, пришел мопс, посмотрел как на дуру, потом поставил лапу на край политилена, пупырышки чпокнули, мопс проникся, сидим теперь лопаем вдвоем.\r\n',	1,	1,	'#61E8FF',	'',	'',	'',	'',	0,	'',	'',	49,	27,	5,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'648',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
