(11221,	'рассказывая истории',	'Малой прав\r\nУтром сын, наблюдая картину как я покрываю прическу лаком для волос, говорит:\r\n- Мама, зря ты дихлофос переводишь, твои тараканы бессмертны!\r\n…А ведь он прав.\r\n',	1,	1,	'#75FF54',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'97',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11222,	'рассказывая истории',	'Малой прав\r\nУтром сын, наблюдая картину как я покрываю прическу лаком для волос, говорит:\r\n- Мама, зря ты дихлофос переводишь, твои тараканы бессмертны!\r\n…А ведь он прав.',	1,	0,	'#6CFF57',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'97',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11223,	'рассказывая истории',	'Узи\r\nХодила на узи органов малого таза. Девственницам делают обычное узи, а девушкам, ведущим половую жизнь, трансвагинальное. Это довольно неприятная процедура, поэтому я сказала, что девственница. Оказалось, что я беременна. Видели бы вы глаза врача.\r\n',	1,	1,	'#FFDE33',	'',	'',	'',	'',	0,	'',	'',	49,	0,	13,	'ru',	0,	'',	'',	'',	0,	'',	3,	0,	0,	'104',	'',	0,	'',	'4',	'',	'1',	'1',	'0',	'',	''),
