(11225,	'рассказывая истории',	'Уборка по-мужски\r\nЖена попросила разобраться с игрушками, в которые дети уже не играют. Итог: потренькал на детском синтезаторе, собрал пазл, построил башню, поиграл в танковый бой. Жена сказала, что уберёт сама.\r\n',	1,	1,	'#DDADFF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	12,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1426',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
