(11227,	'рассказывая истории',	'Претензия\r\nОдна женщина обратилась в суд, требуя компенсацию от госпиталя. По ее словам, после того как ее муж вернулся после лечения, он полностью потерял интерес к сексу и к ней как к женщине. В свое оправдание представители госпиталя сообщили, что проводили операцию на глаза и вернули пациенту зрение.\r\n',	1,	1,	'#E7FF53',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'ru',	0,	'',	'',	'',	0,	'',	3,	0,	0,	'81',	'',	0,	'',	'4',	'',	'1',	'1',	'0',	'',	''),
(11228,	'рассказывая истории',	'Претензия\r\nОдна женщина обратилась в суд, требуя компенсацию от госпиталя. По ее словам, после того как ее муж вернулся после лечения, он полностью потерял интерес к сексу и к ней как к женщине. В свое оправдание представители госпиталя сообщили, что проводили операцию на глаза и вернули пациенту зрение.\r\n',	1,	0,	'#FFFB58',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'ru',	1,	'',	'',	'',	0,	'',	3,	0,	0,	'81',	'',	0,	'',	'4',	'',	'1',	'1',	'0',	'',	''),
(11229,	'рассказывая истории',	'В Детском мире\r\nБыл недавно в Детском Мире и увидел там, как маленький мальчик всё выпрашивал у мамы пистолет с патронами. Спустя 10 минут уговоров мама наклонилась к нему и спросила: \"А ты будешь любить меня ещё больше?\" На что мальчик ответил: \"Мам, я уже и так на пределе!\"',	1,	1,	'#7FDCE3',	'',	'',	'',	'',	0,	'',	'',	49,	0,	6,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'915',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
