(11231,	'рассказывая истории',	'Папина жена\r\nДочери 6 лет, наказала её за очередной подвиг, а она в отместку написала такой стишок:\r\n\"Целый день она кричит,\r\nНикогда не замолчит!\r\nДогадайтесь, кто она?\r\nЭто ПАПИНА ЖЕНА!\"\r\n',	1,	1,	'#EFCFFF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	13,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'50',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
