(11233,	'рассказывая истории',	'Варим сгущенку\r\nЖена решила с детьми сделать орешки с вареной сгущенкой. Сгущенку варили часа два. Как потом \"выяснилось\", это была банка с тушенкой.\r\n',	1,	1,	'#FFBB5C',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1253',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
