(11237,	'рассказывая истории',	'Транспорт Санта Клауса\r\nМоей знакомой надо было купить в Финляндии колбасу из оленины, а слово \"олень\" она забыла как на английском. Долго пыталась объяснить продавцу, из чего ей нужна колбаса. Отчаявшись, она выдала \"Santa Claus transport\". Взаимопонимание было достигнуто.',	1,	1,	'#62FF5E',	'',	'',	'',	'',	0,	'',	'',	49,	0,	9,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1413',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11238,	'рассказывая истории',	'Транспорт Санта Клауса\r\nМоей знакомой надо было купить в Финляндии колбасу из оленины, а слово \"олень\" она забыла как на английском. Долго пыталась объяснить продавцу, из чего ей нужна колбаса. Отчаявшись, она выдала \"Santa Claus transport\". Взаимопонимание было достигнуто.',	1,	0,	'#7DFF6B',	'',	'',	'',	'',	0,	'',	'',	49,	0,	9,	'ru',	1,	'',	'',	'',	0,	'',	1,	0,	0,	'1413',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
(11239,	'рассказывая истории',	'В поликлинике\r\nПришла в поликлинику. До начала приёма ещё пятнадцать минут, но очередь уже огромная, куча бабок и хамоватых студентов. Не пустили меня к кабинету, устроили скандал, чуть не задавили. Потому что \"Стой в очереди как все, сучк!\".\r\np.s. Я - врач.',	0,	1,	'#E9FFA3',	'',	'',	'',	'',	0,	'',	'',	49,	10,	9,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'46',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
