(11241,	'рассказывая истории',	'Это Израиль\r\nМоя подруга ездила в Израиль. Там с ней пытался познакомиться парень (местный), она его отшивала, отшивала... а он шел и шел.... Когда понял, что бесполезно с ней знакомиться, попросил денег за то, что проводил.\r\n',	1,	1,	'#66FF6C',	'',	'',	'',	'',	0,	'',	'',	49,	0,	3,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1413',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
