(11243,	'рассказывая истории',	'Сказка\r\nОсталась как-то ночевать у парня. Легли спать, я уже почти засыпаю, как вдруг слышу: \"Анют, Ань.\" Сквозь сон тихим голосом спрашиваю: \"Что такое?\". А он: \"Расскажи мне сказку, пожалуйста...\". Ну меня и дёрнуло ляпнуть: \"Ты у меня первый\". Обиделся ',	1,	1,	'#61D4FF',	'',	'',	'',	'',	0,	'',	'',	49,	0,	1,	'ru',	0,	'',	'',	'',	0,	'',	2,	0,	0,	'472',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
