(11245,	'рассказывая истории',	'Вентиляция\r\nНедавно вспомнили. В детстве мы с братом заметили, что у деда между ног порваны штаны. Нам тогда лет по 6-7 было. Спросили почему так. Он ответил, что для вентиляции. Через час все штаны были порезаны между ног для вентиляции. Таких дрындюлей мы давно не получали.\r\n',	2,	1,	'#FFBB8C',	'',	'',	'',	'',	0,	'',	'',	49,	11,	3,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'610',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
