(11247,	'рассказывая истории',	'Болевой\r\nМоя девушка с давних пор занимается дзюдо. К чему это я? Как то решили мы поэкспериментировать в позах из камасутры. Принимаем выбранную позу и... тут я охреневаю от боли. Потом на вопрос, что это было, она ответила, что с этой позы оказывается так удобно переходить на болевой.',	1,	1,	'#FFFA30',	'',	'',	'',	'',	0,	'',	'',	49,	21,	1,	'ru',	0,	'',	'',	'',	0,	'',	1,	0,	0,	'1580',	'',	0,	'',	'4',	'',	'0',	'0',	'0',	'',	''),
